Great deal on a brand new $150 pair of Blackhawk Warrior Wear Tanto boots in Desert Tan. Very lightweight and breathable and have a built in Orthotic insole so they are designed to be very comfortable to wear for long periods of time. They are awesome boots that are still brand new in box, they have never been worn and the tags are still on them. Size 13 but a 12 could probably wear them too. The first $60 cash offer will get an awesome deal on a great pair of brand new boots.

BLACKHAWK! now offers the Tall Tanto Boot, the tall version of the Tanto Light Hiker. This boot is built for comfort and stability on and off duty, whether on the street or on the trail. If offers outstanding traction, stability, pronation control, and comfort. Features: Ventilated, quick-drying properties are ideal for waterborne or hot-weather operations; 
Vibram “Globetrotter” shock-absorbing rubber outsole; washable, antimicrobial, custom-molded OrthoLite footbed provides quick-drying, breathable cushion that is highly abrasion resistant and will not break down or lose effectiveness over time; waterproof-injected insole board; lightweight, breathable nylon mesh upper with padded collar; self-cleaning, multi-directional lugs and semi-rigid heel and toe cap reinforcement deliver comfort and protection; and is available in 6 and 6.5 Medium and 7-14 Medium and Wide. The boot also offers Injection-Molded Lace Locks: Quick no-tie method is secure and prevents laces from catching on objects and lace ends stow away neatly in lace pocket on tongue.

Brand New with everything in the box (lock, user manual etc.) from the manufacturer, including two 16-round magazines.  I also have three extra 16-round magazines (so Five Managezines in total) for sale if you are interested.

Here is how it works:
$490 for the Brand New gun with TWO magazines ;
$510 for the Brand New gun with THREE magazines;
$530 for the Brand New gun with FOUR magazines;
$540 for the Brand New gun with FIVE magazines (best value).

Bought it and haven't got a chance to shoot it yet.  Selling it because I need money for something else that just came up.  Academy and Gander Mountain has it for over $540 after-tax.  You can save a lot on taxes, shipping fee, FFL transfer fee, etc.

Cash Only.  I will need you to sign a Bill of Sale, and you need to have a valid TX driver's license (I will just take a look).  If you can not own a firearm legally (no valid TX driver's license, underage, felony, etc.), please do not contact me.

I can meet at somewhere that makes both of us feel safe and conformable (for example, near a Police Department or at a shooting range).  Thank you.
